import React, {Component} from "react";
import ToDoItem from "./components/ToDoItem";


class App extends Component {
    constructor(){
        super()
        this.state = {
            name: "Tomas",
            age: "23"
        }
    }

    render(){
        return(
            <div>
                <h1>{this.state.name}</h1>
                <h3>{this.state.age} years old</h3>
            </div>
        )
    }
}

export default App;
